import React from "react";
import styled from "styled-components";

const HeaderEach = styled.div`
  width: 100%;
  height: 56px;
  margin : 0px;
  background-color: #323232;
  display: flex;
  align-items: center;
  justify-content: center;
`;

// padding-left : 16px;
// padding-right : 16px;
// padding-top : 8px;
// padding-bottom : 8px;

const BoxText = styled.p`
  font-size: 30px;
  font-weight: 500;
`;

const Header = (props) => {
  return (
    <>
      <HeaderEach>
      </HeaderEach>
    </>
  );
};

export default Header;
